import{_ as a,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP PROCEDURE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_PROCEDURE.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_PROCEDURE.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_PROCEDURE.md"};function n(d,e,r,p,c,l){return o(),t("div",null,e[0]||(e[0]=[s(`<h1 id="drop-procedure" tabindex="-1">DROP PROCEDURE <a class="header-anchor" href="#drop-procedure" aria-label="Permalink to &quot;DROP PROCEDURE&quot;">​</a></h1><p>Removes a procedure.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP PROCEDURE [IF EXISTS] name ( [ [argmode] [argname] argtype [, ...] ] )</span></span>
<span class="line"><span>    [CASCADE | RESTRICT]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP PROCEDURE</code> removes the definition of an existing procedure. To run this command the user must be the owner of the procedure. The argument types to the procedure must be specified, since several different procedures may exist with the same name and different argument lists.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the procedure does not exist. A notice is issued in this case.</p><p>name : The name (optionally schema-qualified) of an existing procedure. If no argument list is specified, the name must be unique in its schema.</p><p>argmode : The mode of an argument: <code>IN</code> or <code>VARIADIC</code>. If omitted, the default is <code>IN</code>.</p><p>argname : The name of an argument. Note that <code>DROP PROCEDURE</code> does not actually pay any attention to argument names, since only the argument data types are needed to determine the procedure&#39;s identity.</p><p>argtype : The data type(s) of the procedure&#39;s arguments (optionally schema-qualified), if any.</p><p>CASCADE : Automatically drop objects that depend on the procedure, and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the procedure if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>This command removes the procedure named <code>do_db_maintenance</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP PROCEDURE do_db_maintenance();</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>This command conforms to the SQL standard, with these WarehousePG extensions:</p><ul><li><p>The standard only allows one procedure to be dropped per command.</p></li><li><p>The <code>IF EXISTS</code> option.</p></li><li><p>The ability to specify argument modes and names.</p></li></ul><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_PROCEDURE.html">CREATE PROCEDURE</a>, <a href="./ALTER_PROCEDURE.html">ALTER PROCEDURE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,23)]))}const u=a(i,[["render",n]]);export{m as __pageData,u as default};
